import React from 'react';
import logo from './logo.svg';
import './App.css';

function purchase(){
  fetch("http://locahost:8080/v1/purchase").then(
    res => res.json()).then(result => {
      console.log(result);
    })
};


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button onClick={() => purchase()}></button>
      </header>
    </div>
  );
}

export default App;
